import React from 'react';
import { makeStyles } from '@material-ui/core/styles';

import { ThemeProvider } from '@material-ui/styles';
import SignInPic from '../assets/Fridge-signin-pic.png';
import { ReactComponent as FUBULogo } from '../assets/fubu_logo.svg';
import Button from '@material-ui/core/Button';
import Grid from '@material-ui/core/Grid';
import theme from '../theme';

const useStyles = makeStyles((theme) => ({
    root: {
        flexGrow: 1,
    },
    logo: {
        paddingLeft: theme.spacing(.75),
        paddingTop: theme.spacing(9),
        textAlign: 'center',
        color: theme.palette.text.secondary,
    },
    button: {
        width: '246px',
        paddingTop: theme.spacing(0),
        paddingBottom: theme.spacing(0),
        marginTop: '20px',
        marginBottom: '15px',
        fontSize: '24px',
        borderRadius: '8px',
        boxShadow: '0px 4px 8px rgba(0, 0, 0, 0.25)',
    },
    linkButton: {
        fontSize: '24px',
        textDec
    }
}));

function SignIn() {
    const classes = useStyles();

    return (
        <ThemeProvider theme={theme}>
            <Grid container>
                <Grid item xs={6}>
                    <div>
                        <img src={SignInPic} alt="communityFridge" />
                    </div>
                </Grid>
                <Grid item xs={6}>
                    <Grid item xs={12}>
                    <FUBULogo className={classes.logo}></FUBULogo>
                    </Grid>
                    <Grid item xs={8}>
                    <h1> All-in-one platform for community fridges.</h1>
                    </Grid>
                    <Grid item xs={12}>
                    <Button className={classes.button} size="large" variant="contained" color="primary">Sign Up</Button>
                    </Grid>
                    <Grid item xs={12}>
                    <Button className={classes.button} size="large" variant="contained" color="secondary">Login</Button>
                    </Grid>
                    <Grid item xs={12}>
                    <Button className={classes.linkButton}>Learn more</Button>
                    </Grid>
                </Grid>

            </Grid>
        </ThemeProvider>

    );
}

export default SignIn;
